import { Link } from "react-router-dom"
import { isAuthenticated } from "../services/Auth"
import './NavBar.css'

import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';


const drawerWidth = 240;
const navItems = ['Register', 'Login', 'Dashboard','Logout'];



export default function NavBar(props){

    const { window } = props;
    const [mobileOpen, setMobileOpen] = React.useState(false);

    const handleDrawerToggle = () => {
      setMobileOpen((prevState) => !prevState);
    };

    const drawer = (
      <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center' }}>
        <a  className="navbar-brand" href="#" style={{textDecoration:"none",colo}} ><Typography variant="h6" sx={{ my: 2 }}>
        User Authenticator
        </Typography></a>
       {/* <a  className="navbar-brand" href="#" ><h6>User Authenticator</h6></a> */}

        <Divider />
        <List>

            <ListItem  disablePadding>
              <ListItemButton sx={{ textAlign: 'center' }}>
                <ListItemText>Register</ListItemText>
              </ListItemButton>
            </ListItem>
            <ListItem  disablePadding>
              <ListItemButton sx={{ textAlign: 'center' }}>
                <ListItemText>Login</ListItemText>
              </ListItemButton>
            </ListItem>
            <ListItem  disablePadding>
              <ListItemButton sx={{ textAlign: 'center' }}>
                <ListItemText>Dashboard</ListItemText>
              </ListItemButton>
            </ListItem>
            <ListItem  disablePadding>
              <ListItemButton sx={{ textAlign: 'center' }}>
                <ListItemText>Logout</ListItemText>
              </ListItemButton>
            </ListItem>

        </List>
      </Box>
    );

    const container = window !== undefined ? () => window().document.body : undefined;



    return ( <div>


        {/* <nav  className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container-fluid">
                <a className="navbar-brand" href="#">User Authenticator</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">

                        {!isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/">Register</Link></li>):null}
                        {!isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/login" >Login</Link></li>):null}
                        {isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/dashboard" >Dashboard</Link></li>):null}
                        {isAuthenticated()?(<li className="nav-item"><a className="nav-link"  onClick={props.logoutUser} style={{cursor:"pointer"}} >Logout</a></li>):null}
                    </ul>
                </div>
            </div>
            </nav> */}


<Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar component="nav">
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
          <Typography
            variant="h6"
            component="div"
            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
          >
            User Authenticator
          </Typography>
          <Box sx={{ display: { xs: 'none', sm: 'block' } }}>

              <Button  sx={{ color: '#fff' }}>
                Register
              </Button>
              <Button  sx={{ color: '#fff' }}>
                Login
              </Button>
              <Button  sx={{ color: '#fff' }}>
                Dashboard
              </Button>
              <Button  sx={{ color: '#fff' }}>
                Logout
              </Button>

          </Box>
        </Toolbar>
      </AppBar>
      <nav>
        <Drawer
          container={container}
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile.
          }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
        >
          {drawer}
        </Drawer>
      </nav>
      <Box component="main" sx={{ p: 3 }}>
        <Toolbar />
        {/* <Typography>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Similique unde
          fugit veniam eius, perspiciatis sunt? Corporis qui ducimus quibusdam,
          aliquam dolore excepturi quae. Distinctio enim at eligendi perferendis in
          cum quibusdam sed quae, accus
        </Typography> */}
      </Box>
    </Box>


        </div>
            )
}

NavBar.propTypes = {
    /**
     * Injected by the documentation to work in an iframe.
     * You won't need it on your project.
     */
    window: PropTypes.func,
  };
